import React, { Component } from 'react';

export default class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      value: 5,
    };

  }
  handleUpdater = ()=>{
    this.setState({value: this.state.value+1});
  }

  render() {
    return (
      <button onClick={this.handleUpdater}>
        {this.state.value}
      </button>
    );
  }
}
